        <div>
            <div className={'logo'}>

            </div>
            <div>
                <h2>Форма обратной связи</h2>
                <DropdownButton title={'title'} drop={'end'} variant="secondary" />

            </div>
        </div>
    );
};

export default LeftBlock;
